import logo from '../.../s';
import {React,useEffect, useState} from 'react';
import '../../App.css';
import {Route, Redirect, useHistory} from 'react-router-dom'
import Modal from 'react-modal';

const customStyles = {
    content : {
      top                   : '50%',
      left                  : '50%',
      right                 : 'auto',
      bottom                : 'auto',
      marginRight           : '-50%',
      transform             : 'translate(-50%, -50%)',
      backgroundColor: "#d3f1ef",
    }
  };


  function NavBar()
  {

    const history = useHistory();
    const [modalIsOpen,setIsOpen] = useState(false);
    const [buttonString,setButtonString] = useState("");
  
    function openModal(){
      setIsOpen(true);
  }
  
  
    function closeModal(){
      setIsOpen(false);
    }
  
    function Redirect(page){
  
      history.push("/"+page);
      return <Redirect    to={{
        pathname:'/'+page
          }}/>
    }

    return (
        <div className="Home">
          <div className="Top">
            <div>
              <button className="button button1">התנתק</button>
              <button onClick={()=>{Redirect('List')}} className="button button1">רשימת הבקשות שלי</button>
              <button onClick={()=>{Redirect('Home')}} className="button button1">דף הבית</button>
            </div>
            <div className="row">
              <div>שם משתמש</div>
              <img src={logo} alt="Logo"/>
            </div>
          </div>
        </div>
      );



  }


  export default NavBar;
